import "./App.css";
// 헤더
import Header from "./components/Header";
import Footer from "./components/Footer";
import Main_Top from "./components/Main_Top";

function App() {
  return (
    <div className="App">
      <div id="wrapper">
        <Header />
        <Main_Top/>
          <div>
          <img src="/about-style.png" alt="브릿지 설명" width="219"/>
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default App;


